import React from "react";
import "./Navbar.css";
import logo from "./images/logoimg.png";
import callicon from "./images/support.svg";
// import computer from "./images/computer.png";
const Navbar = () => {
  return (
    <div>
      <div className=" logovscall">
        <div className="row">
          <div className="col-sm-12 col-md-7 col-lg-9 logodiv">
            <img src={logo} />
            <p>
              FIZMA<span className="spanfor_soft">SOFT</span>
            </p>
          </div>
          <div className="col-sm-offset-4 col-sm-8 col-md-5 col-lg-3 d-sm-none d-md-block">
            <div className="row call_section  ">
              <img className="call_icon mr-4" src={callicon} />
              <p className="call_num">(90)777 77 07</p>
            </div>
          </div>
        </div>
      </div>
      {/* <div className="container  row justify-content-center  navbar">
        <div className="col-xl-2 col-lg-2  col-md-2 col-sm socials">
          <a>SERVICES</a>
        </div>
        <div className="col-xl-2 col-lg-2  col-md-2 col-sm socials">
          <a>PROJECTS</a>
        </div>
        <div className="col-xl-2 col-lg-2  col-md-2 col-sm socials">
          <a>TIMELINE</a>
        </div>
        <div className="col-xl-2 col-lg-2  col-md-2 col-sm socials">
          <a>TEAM</a>
        </div>
        <div className="col-xl-2 col-lg-2  col-md-2 col-sm socials">
          <a>CONTACT</a>
        </div>
      </div> */}
    </div>
  );
};

export default Navbar;
